import React from "react";



const DisplayWeather = (props) => {
    const {data} = props;
    const temp = Math.floor(data.main.temp - 273.15);
    return ( 
        <div>
            <h3>{data.name}</h3>
            <p>{temp}</p>
        </div>
    );
}

export default DisplayWeather;
